PROBLEM: "Roy's cat eats "$\frac{1}{3}$' of a can of cat food every morning and '$\frac{1}{4}$' of a can of cat food every evening. Before feeding his cat on Monday morning, Roy opened a box containing '$6$' cans of cat food. On what day of the week did the cat finish eating all the cat food in the box?\n'
=======
CHOICES:
[A]: \text{Tuesday}
[B]: \text{Wednesday}
[C]: \text{Thursday}
[D]: \text{Friday}
[E]: \text{Saturday}

PROBLEM: 'Suppose that '$a$' cows give '$b$' gallons of milk in '$c$' days. At this rate, how many gallons of milk will '$d$' cows give in '$e$' days?\n'
=======
CHOICES:
[A]: \frac{bde}{ac}
[B]: \frac{ac}{bde}
[C]: \frac{abde}{c}
[D]: \frac{bcde}{a}
[E]: \frac{abc}{de}

PROBLEM: 'Three fair six-sided dice are rolled. What is the probability that the values shown on two of the dice sum to the value shown on the remaining die?\n'
=======
CHOICES:
[A]: \dfrac16
[B]: \dfrac{13}{72}
[C]: \dfrac7{36}
[D]: \dfrac5{24}
[E]: \dfrac29

PROBLEM: 'Positive integers '$a$' and '$b$' are such that the graphs of '$y=ax+5$' and '$y=3x+b$' intersect the '$x$'-axis at the same point. What is the sum of all possible '$x$'-coordinates of these points of intersection?\n'
=======
CHOICES:
[A]: {-20}
[B]: {-18}
[C]: {-15}
[D]: {-12}
[E]: {-8}
